#pragma mark - 懒加载
- (PaintingliteSessionManager *)sessionM{
    if (!_sessionM) {
        _sessionM = [PaintingliteSessionManager sharePaintingliteSessionManager];
    }
    
    return _sessionM;
}

- (PaintingliteExec *)exec{
    if (!_exec) {
        _exec = [[PaintingliteExec alloc] init];
    }
    
    return _exec;
}

- (PaintingliteAggregateFunc *)aggreageteF{
    if (!_aggreageteF) {
        _aggreageteF = [PaintingliteAggregateFunc sharePaintingliteAggregateFunc];
    }
    
    return _aggreageteF;
}

- (PaintingliteSplitTable *)spliteTable{
    if (!_spliteTable) {
        _spliteTable = [PaintingliteSplitTable sharePaintingliteSplitTable];
    }
    
    return _spliteTable;
}

- (PaintinglitePressureOS *)pressureOS{
    if (!_pressureOS) {
        _pressureOS = [PaintinglitePressureOS sharePaintinglitePressureOS];
    }
    
    return _pressureOS;
}

